import './Navbar.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope, faHouse,faNotesMedical,faAddressCard} from '@fortawesome/free-solid-svg-icons';

export default function Navbar() {
    return (
        <div>
            <nav class="navbar">
                <div class="container">
                    <h1 class="logo">Jathusan</h1>
                    <ul class="nav-links">

                        <li> <FontAwesomeIcon  icon={faHouse} className='icon'/> <a href="/"> Home</a></li>
                        <li><FontAwesomeIcon icon={faNotesMedical}className='icon'/><a href="/Node">Node</a></li>
                        <li> <FontAwesomeIcon icon={faAddressCard}className='icon' /><a href="/About">About</a></li>
                        <li><FontAwesomeIcon  icon={faEnvelope} className='icon'/> <a href="/Contact"> Contact</a></li>
                    </ul>
                </div>
            </nav>
        </div>
    )
}
